      <text id="152" justification="0" size="4" underlined="false">
        <text>Various types of moves will be
established corresponding to
what the user, entity, power-up, 
etc is concerned with when validating
 the movement. Accordingly I tried 
to represent this by having the tick() from 
the GameState going to every possible
movable object. Each type of object 
won&apos;t move each tick() necessarily, it is
just hard to represent these situational
calls.</text>
